import React from 'react'

function Form(props) {
  return (
    <div>
        {props.user ? (
            <div className = "mb-3">

            <label htmlForm = "title" className= "form-label">Title</label>

            <input type="text" className="form-control"
            placeholder= "Please Enter Title"
            />
         </div>
        ):null}
            
            
        
        
        
    </div>
  )
}

export default Form
